// EmailService is the interface for email operations
type EmailService interface {
	SendEmail(to []string, subject, body string) error
	SendPasswordResetEmail(to string, newPassword string) error
	SendTicketsEmail(to string, orderOverview OrderOverview, orderItems []OrderInfo, tickets []TicketInfo) error
}

type emailService struct {
	from         string
	host         string
	port         string
	username     string
	password     string
	useSSL       bool
	useOAuth     bool
	tokenManager *OAuth2TokenManager
}

